import React from 'react';
import { Text, StyleSheet } from 'react-native';

const Header = () => {
    return (
        <Text style={styles.text}>Headeer</Text>
    );
};

const styles = StyleSheet.create({
    text: {
      color: '#000',
      fontSize: 50
    }
  });
  

export default Header;
